import Nav from "./Nav"
import { Outlet } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import { LoginValueContext } from "../global/Loginvalue";
import { useContext } from "react";

const Courses = () => {

        
        const {loggedInValue, setLoggedInValue} = useContext(LoginValueContext)
        const navigate = useNavigate();

        const sendLogoutData = (event) => {
                
                navigate("/home")
        }

        return (

                <div>
                        <h1>This is Courses page</h1>
                        <button type="submit" className="w-full text-white bg-blue-500  font-medium rounded-lg text-sm px-5 py-2.5 text-center  hover:bg-[#87acec] "
                                                onClick={(e) => sendLogoutData(e)} >Logout</button>
                </div>
                
                

        )



}

export default Courses;
